            <h3 class=""medium_heading""> II. PEDAGOGICAL OBJECTIVES    </h3>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 1. Origin of the program </h3>
                <p class=""description""> 
                    With Public Health being defined by the World Health Organization as “the collective responsibility for the health of a population in its living
                    environment, whether it is care, prevention, education or social hygiene”, the course of Master in Public Health at Business Intelligence Institute
                    of Management allows the student to specialize in one of the 6 concentrations proposed.
                </p>
            </div>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 2. Objectives of the program </h3>
            ");
            WriteLiteral(@"    <h3 class=""smaller_heading""> II.2.1. General objective </h3>
                <p class=""description""> 
                    The general objective of the master’s degree in public health is to train future professionals and researchers in the main areas of public health
                    (epidemiology, biostatistics, health management and policy, health promotion and education, occupational health, environmental health) capable
                    of understanding, analysing and treating population health problems in a comprehensive and multidisciplinary approach.                    
                </p>

                <h3 class=""smaller_heading""> II.2.2. Specific Objectives </h3>
                <p class=""description""> 
                    <strong> Commun run to the mention </strong><br/>
                    The Master in Public Health trains autonomous public health professionals who can carry out activities that contribute to
                </p>
                <ul class=""one_list"">
    ");
            WriteLiteral(@"                <li> 
                        the description and monitoring of health at the population level,
                    </li>
                    <li> 
                        knowledge of the determinants of health,
                     </li>
                    <li> 
                        health promotion and education,
                    </li>
                    <li> 
                        the design, implementation and evaluation of health actions,
                    </li>
                    <li> 
                        public health planning and management,
                     </li>
                    <li> 
                        planning, carrying out and interpreting statistical analyses in health,
                    </li>
                    <li> 
                        the management of information systems and the processing of biomedical and health information, with a view to protecting and improving
                        the health status of populatio");
            WriteLiteral(@"ns.
                    </li>
                </ul>

                <h3 class=""small_heading""> II.3. Program approach   </h3>
                <p class=""description""> 
                    The first year of the master’s degree (M1) corresponds to 60 ECTS (European Credit Transfer System) and is organised in two semesters; after a
                    common core of 30 ECTS covering most areas of public health (biostatistics, epidemiology, genetics, ethics and ethics), students choose 18
                    ECTS according to their personal and professional project, then complete a 2-month internship with written report.
                    The second year (M2) offers 6 different specialties listed below, with in addition to the validation of specific credits units, a 6-month research
                    initiation course. <br/> 
                    The proposed routes are:
                </p>
                <ul class=""one_list"">
                    <li> 
                        Methods for thera");
